import React from 'react';
import SearchField from './SearchField.jsx';
import '../styles/Header.css';

const Header = props => {
    return (
        <div className={'header__wrapper'}>
            <header className={'header'}>
                <h2 className={'header__title'}>
                    Busca de processos
                </h2>
                <SearchField />
                <button
                    className={''}
                    onClick={() => { }}>
                    NOVO
                </button>
            </header>
        </div>
    )
};

export default Header;
